Function.Text:
using System;
using Altaxo;
using Altaxo.Calc;
using Altaxo.Data;
namespace Altaxo.Calc
{
    public class FunctionEvaluationScript : Altaxo.Calc.FunctionEvaluationScriptBase
    {
        Altaxo.Calc.Regression.Nonlinear.IFitFunction f = new Altaxo.Calc.FitFunctions.Transitions.LinearFermiDiracTransition();
        double[] parameters = new double[]{2, 10, 0.3, 0.01};
        double[] xx = new double[1];
        double[] yy = new double[1];

        public override double EvaluateFunctionValue(double x)
        {
            // ----- add your script below this line -----
            xx[0] = x;
            f.Evaluate(xx, parameters, yy);

            return yy[0];

            // ----- add your script above this line -----
#region ScriptFooter
        } // method
    } // class
} //namespace
#endregion
